import React, { useState } from "react";
import { Button,} from "@mui/material";

export default function AboutPageButton({ Text }) {

  return (
    <>
      <Button
        onClick={() => setActive(true)}
        disableRipple={1}
        style={{ background: "none" }}
      >
        {Text}
      </Button>
    </>
  );
}
